import './App.css';
import Navbar from './container/Navbar';
import NewsItem from './container/NewsItem';
import { BrowserRouter,Route,Routes } from 'react-router-dom';

function App() {
  return (
     <>
     <BrowserRouter>
     <Navbar/>
      <Routes>
        <Route path='/' element={<NewsItem/>}></Route>
      </Routes>
     </BrowserRouter>


      <NewsItem/>
     </>
  );
}

export default App;
